import { motion } from 'framer-motion';
const textAnimation = {
  hidden: {
    x: 100,
    opacity: 0,
  },
  visible: custom => ({
    x: 0,
    opacity: 1,
    transition: { delay: custom * 2 }, 
  }),
}

const Hero = () => {
  return (
    <motion.section
      initial="hidden"
      whileInView="visible"
    >
    
      <article className={classes.text}>
        <motion.h1 custom={4} variants={textAnimation} className="">More than just shorter links</motion.h1>
        <motion.p custom={1} variants={textAnimation} className="">Technology</motion.p>
        <motion.p custom={2} variants={textAnimation} className="">+</motion.p>
        <motion.p custom={3} variants={textAnimation} className="" >Creativity</motion.p>
      </article>
    </motion.section>
  )
}

export { Hero };
